from sympy import Symbol, expand, diff, solve
from sympy.simplify import simplify

a = Symbol("a", real=True)
b = Symbol("b", real=True)
c = Symbol("c", real=True)
d = Symbol("d", real=True)
e = Symbol("e", real=True)
x = Symbol("x", real=True)
y = Symbol("y", real=True)
n = Symbol("n", real=True)

eq = (a*x**4 + b*x**3 + c*x**2 + d*x + e - y)**2
#print(expand(eq))
x8 = Symbol("x8", real=True)
x7 = Symbol("x7", real=True)
x6 = Symbol("x6", real=True)
x5 = Symbol("x5", real=True)
x4 = Symbol("x4", real=True)
x3 = Symbol("x3", real=True)
x4y = Symbol("x4y", real=True)
x3y = Symbol("x3y", real=True)
x2y = Symbol("x2y", real=True)
x2 = Symbol("x2", real=True)
xy = Symbol("xy", real=True)
y2 = Symbol("y2", real=True)
eq = a**2*x8 + 2*a*b*x7 + 2*a*c*x6 + 2*a*d*x5 + 2*a*e*x4\
    - 2*a*x4y + b**2*x6 + 2*b*c*x5 + 2*b*d*x4 + 2*b*e*x3\
    - 2*b*x3y + c**2*x4 + 2*c*d*x3 + 2*c*e*x2 - 2*c*x2y\
    + d**2*x2 + 2*d*e*x - 2*d*xy + e**2*n - 2*e*y + y2
di_a = diff(eq, a)
di_b = diff(eq, b)
di_c = diff(eq, c)
di_d = diff(eq, d)
di_e = diff(eq, e)

rr = solve([di_a, di_b, di_c, di_d, di_e],
           (a, b, c, d, e))
print(rr)

